The First World War shaped the world in which we live today. The number of countries that were involved made it impossible to not have a long-lasting effect, whether negative or positive. There are those who believe it should never have happened, those who feel it was absolutely necessary, those by whom it is respectfully celebrated and those by whom it is quietly remembered. Views will, naturally, differ between nations and individuals, and this book delves deep into the battles and people.


